import React from "react";


// reactstrap components
import {
  CardBody,
  Col
} from "reactstrap";



class Conclusion extends React.Component {
  render() {
    return (
      <>
        <div className="content">
          <CardBody>
          <Col className="ml-auto mr-auto" md="6" lg="7">
                <h3>Conclusie</h3>
                <h4>Gaze</h4>
                <p></p>
                <h4>Brain</h4>
                <p></p>
                <h4>Touch</h4>
                <p></p>
                <h4>Speech</h4>
                <p></p>
                <h4>Gesture</h4>
                <p></p>
              </Col>
          </CardBody> 
        </div>
      </>
    );
  }
}

export default Conclusion;
